script: |
  super -f text -I q8896.spq | sort > q8896.out

inputs:
  - name: q8896.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT - col2 * - col2 * + col1 NOT IN ( + ( + + col1 ) * - 81 + + 66 - - 57 + + col2 * - col1 * + col0 * - - ( - col1 ) + + 28 );
  - name: tab2

outputs:
  - name: q8896.out
    data: |
